    return(
        <>
        <h3>Add</h3>
        <div>
            <input type="text" id="city" 
            value={values.city} placeholder={"Enter city"}
            onChange={setValues(e.target.value)}/>

            <input type="text" id="state" value={values.state}  
            placeholder={"Enter state"}
            onChange={setValues(e.target.value)}/>

            <button onClick={sendData}>Submit</button>
            <div id="result"></div>
        </div>

        </>
    );
}

export default Add;
